function carSense = turnLanes()% This is a nested function which will read the Hall Effect sensors% to sense if a car is present at the turn lane.% Inputs: None% Local Outputs: None% Global outputs: [TLAseq, TLCseq] global TLAseq % Declare TurnLane Variables as global. global TLCseq t = gtime();carSense = [digitalRead(11), digitalRead(12)];carTLA = carSense(1);carTLC = carSense(2);if t < 0.1  if carTLC == 1 % Read Hall Effect Sensor (may be zero instead of 1)  TLCseq = 1;  endelseif 20.9 < t < 21  if carTLA == 1  TLAseq = 1;  endendend